import React from 'react';
import './Unit.css';

function Unit({ unit }){
    const topics = [
        ['Types of Variables', 'Converting Categorical Data into Numeric Data']
        ['K-Means', 'Principal Component Analysis (PCA)']
    ];
    const subUnitList = topics[unit].map(title => <li>{title}</li>);
    return (
        <div className={`unit${unit}`}>
            <h2>Unit {unit}</h2>
            <ul>{subUnitList}</ul>
        </div>
    );
};
export default Unit;
